Wiggo's Tour

Travel Documentary hosted by Gary Imlach, published by ITV in 2012 - English narration


Information
------------------------------

Gary Imlach looks back at an incredible three weeks last summer when Bradley Wiggins became the first Briton to win cycling's biggest prize - the Tour de France. In the previous 98 editions of this legendary race no Britain had even managed to get a foot on the podium in Paris. This year the top two steps where occupied by Wiggins and his team mate and fellow Brit Chris Froome. For once the great British sprinter Mark Cavendish had to stay on the sidelines for much of the Tour. The Manx Express did finally have his day though as British cycling fans were treated to the unforgettable sight of Wiggins in the yellow jersey setting up Cavendish for an historic fourth Paris stage victory on the final day.

